if mibBuilder.loadTexts: hh3cRTSubIfTable.setDescription('This table contains objects to create or delete sub interfaces. To create a sub interface, a valid parent interface must be specified by hh3cRTSubIfParentIfIndex and the hh3cRTSubIfOrdinal must be in the range between hh3cRTMinSubIfOrdinal and hh3cRTMaxSubIfOrdinal of the parent interface from hh3cRTParentIfTable. Sub interfaces are logical virtual interfaces configured on a main interface. The main interface can be either a physical interface (such as a Layer 3 Ethernet interface) or a logical interface (such as an MFR interface). The subinterfaces on a main interface share the physical layer parameters of the main interface but can have link layer and network layer parameters of their own. Disabling or enabling a subinterface does not affect the main interface, but the main interface status change affects the subinterfaces. The subinterfaces cannot operate normally unless the main interface is connected. A single physical interface containing multiple subinterfaces enables you to network in a more flexible way. You can create subinterfaces for the following physical interfaces: Ethernet interface. An Ethernet subinterface associated with no VLAN supports only IPX, while an Ethernet subinterface associated with a VLAN supports both IP and IPX. WAN interfaces with their data link layer protocols being frame relay, whose subinterfaces support IP and IPX. WAN interfaces with their data link layer protocols being X.25, whose subinterfaces support IP and IPX. ATM interface, whose subinterfaces support only IP.')
